import React from 'react';
import '../scss/pageEnConstruction.scss';

function pageEnConstruction() {
  return (
    <div className="en-construction-container">
      <img src="/construction.png" alt="En construction" className="construction-image" />
      <h1>Page en cours de construction</h1>
      <p>Cette page sera disponible prochainement. Merci de votre patience.</p>
    </div>
  );
}

export default pageEnConstruction;
